import { useState } from "react";
import profile_pic from './../profile_pic.JPEG'

function Home() {
	const logo = require('./../profile_pic.JPEG');
	return (
		<div>
			<div className='text-center'>Hi, I am </div>
			<img className='w-3/12 h-3/12 rounded-full' src={logo} />
            <a href={require("../Alex_Resume.pdf")} download="Alex_Nguyen_Resume">Download file</a>
        </div>
	);
}

export default Home;
